import React from 'react';
import './style.css';

const Dashboard = () =>{
	return(
		<div className="container">
			<div className="sideBar">
				Barra Lateral
			</div>
			<div className="cardColumn">
				<div className="labelTitle">
					Titulo
				</div>

				<div className="headerCards">
					dual card
				</div>

				<div className="bodyCards">
					triple card
				</div>
			</div>
		</div>
	);
}

export default Dashboard();
